          <Text>Description</Text>
        </Container>

        <Container flex={false} color="transparent">
          <Text>Footer</Text>
        </Container>
      </CardHeader>
      <Text>Image</Text>
      <Text>Description</Text>
      <Text>Footer</Text>
    </HouseWrapper>
  );
};

export default HouseItem;
